import React from 'react';
import ReactDom from 'react-dom';

var date = new Date(2020, 10, 3, 20);

if(date.getHours() < 12){
  var strTime = 'Morning';
}else if(date.getHours() > 12 && date.getHours() < 8 ){
  var strTime = 'Afternoon';
}else {
  var strTime = 'Evening';
}
ReactDom.render(
  <>
  <h1>Hello Sir, Good {strTime}</h1>
  </>
  ,
  document.getElementById('root')
)
